B.azQ=new A.o(B.df,['<div style="line-height: 1.8;"><h1 style="color: #cbffaa; margin-bottom: 20px; font-size: 28px;">Gizlilik Politikas\u0131</h1><p style="margin-bottom: 15px;"><strong>Son G\xfcncelleme:</strong> 2025 y\u0131l\u0131</p><p style="margin-bottom: 20px;">Dandungol olarak, kullan\u0131c\u0131lar\u0131m\u0131z\u0131n gizlili\u011fine b\xfcy\xfck \xf6nem veriyoruz. Bu Gizlilik Politikas\u0131, Dandungol uygulamas\u0131 ve web sitesi arac\u0131l\u0131\u011f\u0131yla toplad\u0131\u011f\u0131m\u0131z, kulland\u0131\u011f\u0131m\u0131z, saklad\u0131\u011f\u0131m\u0131z ve payla\u015ft\u0131\u011f\u0131m\u0131z ki\u015fisel bilgiler hakk\u0131nda sizleri bilgilendirmek amac\u0131yla haz\u0131rlanm\u0131\u015ft\u0131r.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">1. Toplanan Bilgiler</h2><h3 style="color: #cbffaa; margin-top: 20px; margin-bottom: 10px; font-size: 18px;">1.1. Ki\u015fisel Bilgiler</h3><p style="margin-bottom: 15px;">Uygulamam\u0131z\u0131 kullan\u0131rken a\u015fa\u011f\u0131daki ki\u015fisel bilgileri toplayabiliriz:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Ad, soyad ve ileti\u015fim bilgileri</li><li>E-posta adresi</li><li>Telefon numaras\u0131</li><li>Kullan\u0131c\u0131 ad\u0131 ve \u015fifre</li><li>Profil foto\u011fraf\u0131</li><li>Do\u011fum tarihi</li></ul><h3 style="color: #cbffaa; margin-top: 20px; margin-bottom: 10px; font-size: 18px;">1.2. Teknik Bilgiler</h3><p style="margin-bottom: 15px;">Uygulamam\u0131z\u0131n \xe7al\u0131\u015fmas\u0131 i\xe7in a\u015fa\u011f\u0131daki teknik bilgileri otomatik olarak toplayabiliriz:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Cihaz bilgileri (model, i\u015fletim sistemi, versiyon)</li><li>IP adresi</li><li>Taray\u0131c\u0131 t\xfcr\xfc ve versiyonu</li><li>Kullan\u0131m verileri (sayfa g\xf6r\xfcnt\xfclemeleri, t\u0131klamalar)</li><li>Konum bilgisi (izin verildi\u011finde)</li><li>\xc7erezler ve benzeri takip teknolojileri</li></ul><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">2. Bilgilerin Kullan\u0131m Amac\u0131</h2><p style="margin-bottom: 15px;">Toplad\u0131\u011f\u0131m\u0131z bilgileri a\u015fa\u011f\u0131daki ama\xe7larla kullan\u0131r\u0131z:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Hizmetlerimizi sa\u011flamak ve geli\u015ftirmek</li><li>Kullan\u0131c\u0131 hesaplar\u0131n\u0131 y\xf6netmek</li><li>Turnuva ve etkinlikleri d\xfczenlemek</li><li>Kullan\u0131c\u0131 deneyimini ki\u015fiselle\u015ftirmek</li><li>Teknik destek sa\u011flamak</li><li>G\xfcvenlik ve doland\u0131r\u0131c\u0131l\u0131k \xf6nleme</li><li>Yasal y\xfck\xfcml\xfcl\xfcklerimizi yerine getirmek</li><li>\u0130statistiksel analizler yapmak</li><li>Pazarlama ve ileti\u015fim faaliyetleri (izin verildi\u011finde)</li></ul><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">3. Bilgilerin Payla\u015f\u0131m\u0131</h2><p style="margin-bottom: 15px;">Ki\u015fisel bilgilerinizi a\u015fa\u011f\u0131daki durumlarda \xfc\xe7\xfcnc\xfc taraflarla payla\u015fabiliriz:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li><strong>Hizmet Sa\u011flay\u0131c\u0131lar:</strong> Uygulamam\u0131z\u0131n \xe7al\u0131\u015fmas\u0131 i\xe7in gerekli hizmetleri sa\u011flayan \xfc\xe7\xfcnc\xfc taraf \u015firketler</li><li><strong>Yasal Zorunluluklar:</strong> Yasalara uyum sa\u011flamak veya mahkeme kararlar\u0131na uymak</li><li><strong>\u0130\u015f Ortaklar\u0131:</strong> Turnuva organizat\xf6rleri ve sponsorlar (sadece gerekli bilgiler)</li><li><strong>\u0130zin Verildi\u011finde:</strong> A\xe7\u0131k\xe7a izin verdi\u011finiz durumlarda</li></ul><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">4. Veri G\xfcvenli\u011fi</h2><p style="margin-bottom: 15px;">Ki\u015fisel bilgilerinizin g\xfcvenli\u011fini sa\u011flamak i\xe7in end\xfcstri standard\u0131 g\xfcvenlik \xf6nlemleri kullan\u0131yoruz:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>SSL/TLS \u015fifreleme teknolojileri</li><li>G\xfcvenli sunucu altyap\u0131s\u0131</li><li>D\xfczenli g\xfcvenlik denetimleri</li><li>Eri\u015fim kontrol\xfc ve yetkilendirme mekanizmalar\u0131</li><li>Veri yedekleme sistemleri</li></ul><p style="margin-bottom: 15px;">Ancak, internet \xfczerinden hi\xe7bir veri aktar\u0131m\u0131 %100 g\xfcvenli de\u011fildir. Bu nedenle, bilgilerinizi korumak i\xe7in elimizden geleni yapsak da, mutlak g\xfcvenlik garantisi veremeyiz.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">5. \xc7erezler ve Takip Teknolojileri</h2><p style="margin-bottom: 15px;">Uygulamam\u0131z, kullan\u0131c\u0131 deneyimini iyile\u015ftirmek ve hizmetlerimizi analiz etmek i\xe7in \xe7erezler ve benzeri takip teknolojileri kullan\u0131r. \xc7erez tercihlerinizi taray\u0131c\u0131 ayarlar\u0131n\u0131zdan y\xf6netebilirsiniz.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">6. Kullan\u0131c\u0131 Haklar\u0131</h2><p style="margin-bottom: 15px;">KVKK ve GDPR kapsam\u0131nda a\u015fa\u011f\u0131daki haklara sahipsiniz:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Ki\u015fisel verilerinize eri\u015fim hakk\u0131</li><li>Ki\u015fisel verilerinizin d\xfczeltilmesini talep etme hakk\u0131</li><li>Ki\u015fisel verilerinizin silinmesini talep etme hakk\u0131</li><li>Ki\u015fisel verilerinizin i\u015flenmesine itiraz etme hakk\u0131</li><li>Ki\u015fisel verilerinizin ta\u015f\u0131nabilirli\u011fi hakk\u0131</li><li>\u0130\u015fleme faaliyetlerine itiraz etme hakk\u0131</li></ul><p style="margin-bottom: 15px;">Bu haklar\u0131n\u0131z\u0131 kullanmak i\xe7in bizimle ileti\u015fime ge\xe7ebilirsiniz.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">7. Veri Saklama S\xfcresi</h2><p style="margin-bottom: 15px;">Ki\u015fisel bilgilerinizi, yasal y\xfck\xfcml\xfcl\xfcklerimiz ve hizmetlerimizin sa\u011flanmas\u0131 i\xe7in gerekli oldu\u011fu s\xfcrece saklar\u0131z. Hesab\u0131n\u0131z\u0131 sildi\u011finizde, ki\u015fisel bilgileriniz yasal saklama s\xfcreleri d\u0131\u015f\u0131nda silinir veya anonimle\u015ftirilir.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">8. \xc7ocuklar\u0131n Gizlili\u011fi</h2><p style="margin-bottom: 15px;">Uygulamam\u0131z 13 ya\u015f alt\u0131ndaki \xe7ocuklardan bilerek ki\u015fisel bilgi toplamaz. E\u011fer 13 ya\u015f alt\u0131nda bir \xe7ocu\u011fun bilgilerini toplad\u0131\u011f\u0131m\u0131z\u0131 fark edersek, bu bilgileri derhal sileriz.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">9. Gizlilik Politikas\u0131 De\u011fi\u015fiklikleri</h2><p style="margin-bottom: 15px;">Bu Gizlilik Politikas\u0131n\u0131 zaman zaman g\xfcncelleyebiliriz. \xd6nemli de\u011fi\u015fiklikler yap\u0131ld\u0131\u011f\u0131nda, kullan\u0131c\u0131lar\u0131m\u0131z\u0131 uygulama i\xe7i bildirim veya e-posta yoluyla bilgilendiririz. De\u011fi\u015fikliklerin y\xfcr\xfcrl\xfc\u011fe girmesi, g\xfcncellenmi\u015f politikay\u0131 yay\u0131nlad\u0131\u011f\u0131m\u0131z tarihten itibaren ge\xe7erlidir.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">10. \u0130leti\u015fim</h2><p style="margin-bottom: 15px;">Gizlilik politikam\u0131z hakk\u0131nda sorular\u0131n\u0131z, endi\u015feleriniz veya haklar\u0131n\u0131z\u0131 kullanmak i\xe7in bizimle ileti\u015fime ge\xe7ebilirsiniz:</p><p style="margin-bottom: 15px;"><strong>E-posta:</strong> privacy@dandungol.com<br><strong>Adres:</strong> Dandungol E-Sports, T\xfcrkiye</p><p style="margin-top: 30px; margin-bottom: 15px; font-style: italic;">Bu Gizlilik Politikas\u0131n\u0131 kabul ederek, bilgilerinizin bu politika kapsam\u0131nda i\u015flenmesini kabul etmi\u015f olursunuz.</p></div>','<div style="line-height: 1.8;"><h1 style="color: #cbffaa; margin-bottom: 20px; font-size: 28px;">Privacy Policy</h1><p style="margin-bottom: 15px;"><strong>Last Updated:</strong> 2025</p><p style="margin-bottom: 20px;">At Dandungol, we place great importance on the privacy of our users. This Privacy Policy has been prepared to inform you about the personal information we collect, use, store and share through the Dandungol application and website.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">1. Information Collected</h2><h3 style="color: #cbffaa; margin-top: 20px; margin-bottom: 10px; font-size: 18px;">1.1. Personal Information</h3><p style="margin-bottom: 15px;">When using our application, we may collect the following personal information:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Name, surname and contact information</li><li>Email address</li><li>Phone number</li><li>Username and password</li><li>Profile photo</li><li>Date of birth</li></ul><h3 style="color: #cbffaa; margin-top: 20px; margin-bottom: 10px; font-size: 18px;">1.2. Technical Information</h3><p style="margin-bottom: 15px;">For our application to function, we may automatically collect the following technical information:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Device information (model, operating system, version)</li><li>IP address</li><li>Browser type and version</li><li>Usage data (page views, clicks)</li><li>Location information (when permitted)</li><li>Cookies and similar tracking technologies</li></ul><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">2. Purpose of Information Use</h2><p style="margin-bottom: 15px;">We use the information we collect for the following purposes:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>To provide and improve our services</li><li>To manage user accounts</li><li>To organize tournaments and events</li><li>To personalize user experience</li><li>To provide technical support</li><li>For security and fraud prevention</li><li>To fulfill our legal obligations</li><li>To conduct statistical analysis</li><li>For marketing and communication activities (when permitted)</li></ul><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">3. Information Sharing</h2><p style="margin-bottom: 15px;">We may share your personal information with third parties in the following circumstances:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li><strong>Service Providers:</strong> Third-party companies that provide services necessary for our application to function</li><li><strong>Legal Requirements:</strong> To comply with laws or court orders</li><li><strong>Business Partners:</strong> Tournament organizers and sponsors (only necessary information)</li><li><strong>When Permitted:</strong> In cases where you have explicitly given permission</li></ul><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">4. Data Security</h2><p style="margin-bottom: 15px;">We use industry-standard security measures to ensure the security of your personal information:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>SSL/TLS encryption technologies</li><li>Secure server infrastructure</li><li>Regular security audits</li><li>Access control and authorization mechanisms</li><li>Data backup systems</li></ul><p style="margin-bottom: 15px;">However, no data transmission over the internet is 100% secure. Therefore, while we do our best to protect your information, we cannot guarantee absolute security.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">5. Cookies and Tracking Technologies</h2><p style="margin-bottom: 15px;">Our application uses cookies and similar tracking technologies to improve user experience and analyze our services. You can manage your cookie preferences from your browser settings.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">6. User Rights</h2><p style="margin-bottom: 15px;">Under KVKK and GDPR, you have the following rights:</p><ul style="margin-left: 20px; margin-bottom: 15px;"><li>Right to access your personal data</li><li>Right to request correction of your personal data</li><li>Right to request deletion of your personal data</li><li>Right to object to processing of your personal data</li><li>Right to data portability</li><li>Right to object to processing activities</li></ul><p style="margin-bottom: 15px;">You can contact us to exercise these rights.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">7. Data Retention Period</h2><p style="margin-bottom: 15px;">We retain your personal information for as long as necessary to fulfill our legal obligations and provide our services. When you delete your account, your personal information will be deleted or anonymized outside of legal retention periods.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">8. Children\'s Privacy</h2><p style="margin-bottom: 15px;">Our application does not knowingly collect personal information from children under 13 years of age. If we discover that we have collected information from a child under 13, we will immediately delete that information.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">9. Privacy Policy Changes</h2><p style="margin-bottom: 15px;">We may update this Privacy Policy from matchDate to matchDate. When significant changes are made, we will notify our users through in-app notifications or email. Changes take effect from the date we publish the updated policy.</p><h2 style="color: #cbffaa; margin-top: 30px; margin-bottom: 15px; font-size: 22px;">10. Contact</h2><p style="margin-bottom: 15px;">If you have questions, concerns, or wish to exercise your rights regarding our privacy policy, you can contact us:</p><p style="margin-bottom: 15px;"><strong>Email:</strong> privacy@dandungol.com<br><strong>Address:</strong> Dandungol E-Sports, Turkey</p><p style="margin-top: 30px; margin-bottom: 15px; font-style: italic;">By accepting this Privacy Policy, you agree to the processing of your information under this policy.</p></div>'],t.w)
